  // render background
  ctx.fillStyle = '#333';
  ctx.fillRect(0, 0, canvas.width, canvas.height);

  // render snake
  ctx.fillStyle = '#0f0';
  ctx.fillRect(0, 0, 20, 50);
  ctx.strokeStyle = '#f00';
  ctx.lineWidth = 3;
  ctx.stroke();
}

function render(){
  ctx.save();

  for(let i = snake.length - 1; i >= 0; i--){
    ctx.beginPath();
    ctx.moveTo(snake[i].x, snake[i].y);
    ctx.lineTo(snake[i].x, snake[i].y);
    ctx.strokeStyle = '#0f0';
    ctx.stroke();
  }

  ctx.restore();

  // request animation frame to manage game
  window.requestAnimationFrame(render);
}

